import React from "react";
import { AppBar, Toolbar, Typography, Button, Grid } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

import { MuiThemeProvider } from "@material-ui/core/styles";
import { theme } from "../theme";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  header: {
    height: 80,
  },
  logo: {
    maxWidth: 60,
  },
  games: {
    padding: theme.spacing(2),
    fontWeight: "bold",
  },
  blog: {
    padding: theme.spacing(2),
    fontWeight: "bold",
  },
  contact: {
    padding: theme.spacing(2),
    fontWeight: "bold",
  },
}));

class Navbar extends React.Component {
  render() {
    const classes = useStyles();
    return (
      <div className={classes.root}>
        <Router>
          <MuiThemeProvider theme={theme}>
            <AppBar position="static">
              <Toolbar className={classes.header}>
                <Grid item xs={6}>
                  <Grid container alignItems="center">
                    <a href="#">
                      <img src="./logo_Dabyss.png" className={classes.logo} />
                    </a>
                    <Typography variant="h6" className={classes.title}>
                      <a href="#">MinigameDabyss</a>
                    </Typography>
                  </Grid>
                </Grid>
                <Grid item xs={6} className={classes.right}>
                  <Grid container alignItems="center" justify="flex-end">
                    <Link to="/Games">
                      <Button color="inherit" className={classes.games}>
                        ゲーム一覧
                      </Button>
                    </Link>
                    <Button color="inherit" className={classes.blog}>
                      ブログ
                    </Button>
                    <Button color="inherit" className={classes.contact}>
                      お問い合わせ
                    </Button>
                  </Grid>
                </Grid>
              </Toolbar>
            </AppBar>
          </MuiThemeProvider>
        </Router>
      </div>
    );
  }
}
